import React from 'react'
import Contacts from '../Contacts'

import { connect } from 'react-redux'

const mapDispatchToProps = dispatch => {
  const setCoords = event =>
    dispatch({
      type: 'set_coords',
      payload: {
        coordsX: event.clientX,
        coordsY: event.clientY,
      },
    })

  return {
    setCoords,
  }
}

const ContanctsContainer = ({ setCoords }) => {
  return <Contacts setCoords={setCoords} />
}

export default connect(null, mapDispatchToProps)(ContanctsContainer)
